# Download: ftp://ftp.ebi.ac.uk/pub/databases/uniprot/current_release/knowledgebase/complete

# GN   ORFNames=FV3-001R;
# GN   Name=14-3-3zeta; Synonyms=14-3-3, 14-3-3EZ, leo, THAP;
# GN   Name=YWHAZ; ORFNames=RCJMB04_11l21;
# GN   Name=Sfn; Synonyms=Mkrn3;
# GN   Name=1-FEHw2 {ECO:0000303|PubMed:12586886, ECO:0000303|Ref.2};
# GN   Name=HLA-A {ECO:0000312|HGNC:HGNC:4931}; Synonyms=HLAA;
# GN   Name=ACS9; Synonyms=ETO3; OrderedLocusNames=At3g49700;
# GN   Name=ccmH; Synonyms=cycL; OrderedLocusNames=R01020; ORFNames=SMc02364;
# GN   Name=B''ALPHA; OrderedLocusNames=At5g44090; ORFNames=MLN1.1;

def parse_uniprot_dat(path):
    # initialize
    gn_parser = re.compile(r'[= ,]([\w\.\'-]+)(?=[^\w\.\'-])(?![=:])')
    ac, gn = '', ''
    # output
    gene_acc = defaultdict(set)
    # if gzipped
    target = os.path.getsize(path)
    if path.suffix == '.gz':
        f = gzip.open(path, mode='rt', encoding='utf-8')
        target = _gzip_size(path)
        while target < os.path.getsize(path):
            # the uncompressed size can't be smaller than the compressed size, so add 4GB
            target += 2**32
    else:
        f = path.open(mode='r', encoding='utf-8')
    with f, tqdm(
        total=target,
        dynamic_ncols=True,
        ascii=True,
        smoothing=0.01,
        desc=path.name,
        unit='B',
        unit_scale=True,
        unit_divisor=1024
    ) as t:
        for line in f:
            t.update(len(line))
            if t.n > t.total:
                t.total += 2**32
            # line code
            lc = line[:2]
            # empty line
            line = line.strip()
            if line.strip() == '':
                continue
            # termination
            if lc == '//':  # last entry has termination
                # process collected lines
                acs = [a.strip() for a in ac.split(';')]
                gns = [g.upper() for g in gn_parser.findall(gn)]
                for a in acs:
                    if not a: continue
                    for g in gns:
                        if not g: continue
                        gene_acc[g].add(a)
                # reset variables
                ac, gn = '', ''
            elif lc == 'AC':
                # ID   MOG_HUMAN               Reviewed;         247 AA.
                # AC   Q16653; A6NDR4; A6NNJ9; A8MY31; B0UZR9; E9PGF0; F8W9D5; O00713;
                # AC   O00714; O00715; Q13054; Q13055; Q14855; Q29ZN8; Q56UY0; Q5JNX7;
                # AC   Q5JNY1; Q5JNY2; Q5JNY4; Q5SSB5; Q5SSB6; Q5STL9; Q5STM0; Q5STM1;
                # AC   Q5STM2; Q5STM5; Q5SUK5; Q5SUK7; Q5SUK8; Q5SUK9; Q5SUL0; Q5SUL1;
                # AC   Q8IYG5; Q92891; Q92892; Q92893; Q92894; Q92895; Q93053; Q96KU9;
                # AC   Q96KV0; Q96KV1; Q99605;
                # DT   01-NOV-1997, integrated into UniProtKB/Swiss-Prot.
                # collect multi AC lines
                ac += line[5:]
            elif lc == 'GN':
                # DE   AltName: Full=Protein SUGAR INSENSITIVE 5 {ECO:0000303|PubMed:10972885};
                # GN   Name=ABI4 {ECO:0000303|PubMed:9634591};
                # GN   Synonyms=ERF052, GIN6 {ECO:0000303|PubMed:10950871},
                # GN   ISI3 {ECO:0000303|PubMed:11439129},
                # GN   SAN5 {ECO:0000303|PubMed:10629000},
                # GN   SIS5 {ECO:0000303|PubMed:10972885}, SUN6 {ECO:0000303|PubMed:9144963};
                # GN   OrderedLocusNames=At2g40220 {ECO:0000312|Araport:AT2G40220};
                # GN   ORFNames=T7M7.16 {ECO:0000312|EMBL:AAD25937.1};
                # OS   Arabidopsis thaliana (Mouse-ear cress).
                # a='Name=ABI4 {ECO:0000303|PubMed:9634591};Synonyms=ERF052, GIN6 {ECO:0000303|PubMed:10950871},ISI3 {ECO:0000303|PubMed:11439129},SAN5 {ECO:0000303|PubMed:10629000},SIS5 {ECO:0000303|PubMed:10972885}, SUN6 {ECO:0000303|PubMed:9144963};OrderedLocusNames=At2g40220 {ECO:0000312|Araport:AT2G40220};ORFNames=T7M7.16 {ECO:0000312|EMBL:AAD25937.1};'
                # >>> re.findall(r'[= ,]([\w.]+)',a)
                # ['ABI4', 'ERF052', 'GIN6', 'ISI3', 'SAN5', 'SIS5', 'SUN6', 'At2g40220', 'T7M7.16']
                gn += line[5:]
    return gene_acc

def print_set_stats(n1, s1, n2, s2, unit=''):
    print(
        f'''
{n1}: {len(s1)} {unit} ({list(s1)[:5]})
{n2}: {len(s2)} {unit} ({list(s2)[:5]})
{n1} & {n2}: {len(s1 & s2)} {unit} ({list(s1 & s2)[:5]})
{n1} | {n2}: {len(s1 | s2)} {unit} ({list(s1 | s2)[:5]})
{n1} - {n2}: {len(s1 - s2)} {unit} ({list(s1 - s2)[:5]})
{n2} - {n1}: {len(s2 - s1)} {unit} ({list(s2 - s1)[:5]})
'''
    )

